import React from "react";
import "../styles/Skills.css";

const skills = [
  { name: "Leadership", description: "Guiding and inspiring others in church activities and community projects." },
  { name: "Teamwork", description: "Collaborating effectively with team members to achieve common goals." },
  { name: "Communication", description: "Sharing ideas clearly and listening actively within the church community." },
  { name: "Event Planning", description: "Organizing church events, services, and outreach programs." },
  { name: "Music & Worship", description: "Participating in or leading worship through singing or playing instruments." },
  { name: "Teaching", description: "Leading Bible studies, Sunday school, or youth group sessions." },
];

const Skills: React.FC = () => (
  <div className="skills-container">
    <h1>Our Skills</h1>
    <div className="skills-list">
      {skills.map((skill, idx) => (
        <div className="skill-card" key={idx}>
          <h3>{skill.name}</h3>
          <p>{skill.description}</p>
        </div>
      ))}
    </div>
  </div>
);

export default Skills;
